import React from 'react';
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";

export default function MembersActive(props){

    return(
        <section>
            <h3>{props.name}</h3>
            <p>{props.id}</p>
            <p>{props.index}</p>
            <p>Active Duration:</p>
            { 
                props.period.map((members,index) =>{
                    return(
                        <span key={index}>
                            <div>Start Time:{members.start_time}</div>
                            <div>End Time:{members.end_time}</div>
                        </span>
                    );
                })
            } 
            <DatePicker
                selected={new Date() ? console.log(new Date()) : console.log("null")}
                inline
                maxDate={new Date()}
                todayButton="#23ccef"
            />
            <button onClick={props.togglePopup}>CLOSE</button>
        </section>
    );
}
